import React from 'react';
import Card from "./Card";
import sdata from "./Sdata";

function netflix(){
    return(
        <Card imgscr={sdata[0].imgscr}
        title={sdata[0].title}
        sname={sdata[0].sname}
        link={sdata[0].link}
        />

        
    );
}

function App(){
    return(
        <>
    <h1 className="heading">Below is the list of Series</h1>
    
    
   {sdata.map(netflix)}
    
    </>
    );
}
export default App;
